    <link rel="icon" href="/favicon.ico" />
    <link
      href="/static/css/ionicons.min.css"
      rel="stylesheet"
    />
    <link href="/static/css/styles.css" rel="stylesheet" />
  </Head>
);

export default HeadSite;
